import React,{ Component } from "react";
import Link from "react-router-dom/Link";

export class Header extends Component{
//this is our navigation bar for the project   
    render()
    {
            return this.props.login ? (
                <div className="col-sm-12">
                    <nav className="navbar navbar-default bg-light">
                    <ul className="nav nav-pills nav-fill">
                    <li className="nav-pills nav-item"><Link to={"/Home"} >AMUSIA</Link></li>
                    <li className="nav-item"><Link to={"/Home"}>Home</Link></li>
                {/* <li class="nav-item"><Link to={"/Login"}>Login</Link></li> */}
                <li class="nav-item"><Link to={"/Logout"}>Log Out</Link></li>
                    <li class="nav-item"><Link to={"/PageNtFound"}>PageNtFound</Link></li>
                    <li class="nav-item"><Link to={"/About"}>About</Link></li>
            </ul>
            </nav>
            </div>
                ) : 
                (
                    <div className="col-sm-12">
                    <nav className="navbar navbar-default bg-light">
                    <ul className="nav nav-pills nav-fill">
                        <li className="nav-pills nav-item"><Link to={"/Home"} >AMUSIA</Link></li>
                        <li className="nav-item"><Link to={"/Home"}>Home</Link></li>
                        <li class="nav-item"><Link to={"/Login"}>Login</Link></li>
                        <li class="nav-item"><Link to={"/Register"}>Register</Link></li>
                        <li class="nav-item"><Link to={"/About"}>About</Link></li>
                    </ul>
                    </nav>
                    </div>
                );
    }
}
